5	Parchado Base de datos	Servicio Administración SAP – Request For Change	1	<p>Se encuentran disponibles parches de base de datos para su aplicaci&oacute;n, se proceder&aacute; con la actualizaci&oacute;n. Esto involucra a todos los sistemas SAP.</p>	<p>A continuaci&oacute;n se detalla el alcance de las actividades a realizar:</p>\r\n\r\n<p>&bull; Descarga de medios</p>\r\n\r\n<p>&bull; Bajada de sistema</p>\r\n\r\n<p>&bull; Aplicaci&oacute;n Parches</p>\r\n\r\n<p>&bull; Subida de sistema</p>\r\n\r\n<p>&bull; Pruebas t&eacute;cnicas</p>\r\n\r\n<p>En:</p>	f	38
