2	Cambio hora invierno	Servicio Administración SAP – Request For Change	1	<p>- Debido al decreto N&ordm; 1286 el d&iacute;a 3 de abril del 2021 se proceder&aacute; con el cambio horario correspondiente a invierno el cual contempla retrasar 1 hora. Para esto deben ser aplicadas las correcciones a nivel de Sistema Operativo y SAP (Nota 2765672). -Se deja sentado en este documento que en caso de alg&uacute;n problema durante el cambio que se podr&iacute;a al reiniciar SAP, OS o apertura de mandante.</p>	<p>A continuaci&oacute;n se detalla el alcance de las actividades a realizar:</p>\r\n\r\n<p>1. Revisi&oacute;n y/o aplicaci&oacute;n de nota Revisi&oacute;n y aplicaci&oacute;n de nota 2765672.</p>\r\n\r\n<p>2. Bajada de sistema:</p>\r\n\r\n<p>3. Monitoreo</p>\r\n\r\n<p>De:</p>\r\n\r\n<p>&nbsp;</p>	f	36
